# types:
#     *: Star
#     **: Double star
#     *Ass: Association of stars
#     OCl: Open Cluster
#     GCl: Globular Cluster
#     Cl+N: Star cluster + Nebula
#     G: Galaxy
#     GPair: Galaxy Pair
#     GTrpl: Galaxy Triplet
#     GGroup: Group of galaxies
#     PN: Planetary Nebula
#     HII: HII Ionized region
#     DrkN: Dark Nebula
#     EmN: Emission Nebula
#     Neb: Nebula
#     RfN: Reflection Nebula
#     SNR: Supernova remnant
#     Nova: Nova star
#     NonEx: Nonexistent object
#     Dup: Duplicated object (see NGC or IC columns to find the master object)
#     Other: Other classification (see object notes)
def get_object_by_type(typ):
    d = {}
    for x, y in obj_list.items():
        if y[0] == typ:
            d[x] = y
    return d


def get_object_by_constellation(constellation):
    d = {}
    for x, y in obj_list.items():
        if y[3] == constellation:
            d[x] = y
    return d


def get_messier_objects():
    d = {}
    for x, y in obj_list.items():
        if y[4].startswith('M'):
            d[x] = y
    return d


# t = type, c = constellation, m = messier
def get_objects(t='', c='', m=False, li=None):
    d = {}

    for x, y in obj_list.items():
        # ti = TargetInfo()
        # ti.set_target(x)
        #if li and ti.type is not 'NonEx' and is_visible(ti, li):
        if m and y[4].startswith('M'): # if messier object
            if t and c:
                if y[0] == t and y[3] == c: # and is_visible(ti, li):
                    d[x] = y
            elif t:  # and is_visible(ti, li):
                if y[0] == t:
                    d[x] = y
            elif c:  # and is_visible(ti, li):
                if y[3] == c:
                    d[x] = y
        else:  # not messier object
            if t and c:
                if y[0] == t and y[3] == c: #  and is_visible(ti, li):
                    d[x] = y
            elif t:  # and is_visible(ti, li):
                if y[0] == t:
                    d[x] = y
            elif c:  # and is_visible(ti, li):
                if y[3] == c:
                    d[x] = y
    return d


def find_objects(q):  #, t):
    d = {}

    for x, y in obj_list.items():

        if x == q or y[4].find(q) >= 0 or y[6].find(q) >= 0:
            d[x] = y

    return d

def get_object_by_id(id):
    return obj_list[id]

